<?phpnamespace Nemundo\Meteo\Emagramm\Install;use Nemundo\App\Scheduler\Setup\SchedulerSetup;use Nemundo\App\Script\Setup\ScriptSetup;use Nemundo\Content\Setup\ContentTypeSetup;use Nemundo\Meteo\Emagramm\Application\EmagrammApplication;use Nemundo\Meteo\Emagramm\Content\Emagramm\EmagrammContentType;use Nemundo\Meteo\Emagramm\Content\Latest\EmagrammLatestContentType;use Nemundo\Meteo\Emagramm\Data\EmagrammModelCollection;use Nemundo\Meteo\Emagramm\Scheduler\EmagrammScheduler;use Nemundo\Meteo\Emagramm\Script\EmagrammCleanScript;use Nemundo\Model\Setup\ModelCollectionSetup;use Nemundo\App\Application\Type\Install\AbstractUninstall;class EmagrammUninstall extends AbstractUninstall{    public function uninstall()    {        (new SchedulerSetup(new EmagrammApplication()))            ->removeScheduler(new EmagrammScheduler());        (new ContentTypeSetup(new EmagrammApplication()))            ->removeContentType(new EmagrammLatestContentType())            ->removeContentType(new EmagrammContentType());        (new ScriptSetup())            ->removeScript(new EmagrammCleanScript());        (new ModelCollectionSetup())            ->removeCollection(new EmagrammModelCollection());    }}